export hidden anti_barrier (
<barrier/>Shield-Piercing weapons are required to break a <barrier/>Barrier Champion's immunity shield in order to stun them. Damaging their shields also halts their health regeneration for 1.6 seconds.

Additionally, Shield-Piercing weapons can overpenetrate an unlimited number of enemies. They also bypass Hydra Shields, Hobgoblin immunity, (Taken) Phalanx shields, and Scorn Buckler shields.

Titan Barricades receive 30% Increased Damage from Shield-Piercing weapons.
)

export hidden overload (
<overload/>Overload Shots/effects apply <overload/>Disruption for <pve 6.5 /> <pvp [5] /> seconds. Applying Disruption stuns <overload/>Overload Champions and prevents them from regenerating health for the duration of the effect.

Disruption decreases damage dealt by PvE Combatants by 25%. It also decreases Melee, Grenade, and Class Ability regeneration speeds by 40% in PvP.
)

export hidden unstoppable (
<unstoppable/>Unstoppable Shots/effects are required to stun <unstoppable/>Unstoppable Champions – immobilizing them and removing their passive 70% Damage Resistance for the duration of the stun.
)

